    handleChange=(e)=>{

        this.setState({
            node:e.target.value
        })
    }

    add=()=>{
        // <Node headNode={this.state.node}/>
    }

    render(){
        return (
            <div className='container'>
            <h3>Your Custom Storage</h3>
            <p>You can max use 4 characters/number for each level's name</p>
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <form className="form-inline my-2 my-lg-0">
                <div>
                <input className="form-control mr-sm-2" type="search" maxLength={4} placeholder="RM1" aria-label="Search" onChange={this.handleChange}/>   
                <small id="inputHelp" className="form-text text-muted">Add top level (example: R1,RM1)</small>

                </div>
                <button className="btn btn-outline-success my-2 my-sm-0" type="submit" onClick={this.add}>ADD</button>

                </form>

            </nav>

            </div>

        )
    }
}
export default App;
